import React, { useState } from 'react';
import '@fortawesome/fontawesome-free/css/all.min.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap/dist/js/bootstrap.bundle.min.js';
import { useTranslation } from 'react-i18next';
import { useNavigate } from 'react-router-dom';
import './Hero.css';

const Hero = () => {
  const { t } = useTranslation();
  const navigate = useNavigate();
  const [searchTerm, setSearchTerm] = useState('');

  const userEmail = localStorage.getItem('userEmail');
  const userRole = localStorage.getItem('userRole');
  const isFreelancer = userEmail && userRole === 'FREELANCER';

  const handleSearch = () => {
    const trimmed = searchTerm.trim();
    if (trimmed) {
      // ‚úÖ Navigate to categorydetails with the search term
      navigate(`/categorydetails?category=${encodeURIComponent(trimmed)}`);
    }
  };

  return (
    <section className="hero-section">
      {/* üéû Video Carousel */}
      <div id="videoCarousel" className="carousel slide carousel-fade" data-bs-ride="carousel">
        <div className="carousel-inner">
          <div className="carousel-item active">
            <video className="d-block w-100" autoPlay muted loop>
              <source src="/Assets/hero.mp4" type="video/mp4" />
            </video>
          </div>
          <div className="carousel-item">
            <video className="d-block w-100" autoPlay muted loop>
              <source src="/Assets/hero2.mp4" type="video/mp4" />
            </video>
          </div>
          <div className="carousel-item">
            <video className="d-block w-100" autoPlay muted loop>
              <source src="/Assets/hero3.mp4" type="video/mp4" />
            </video>
          </div>
        </div>

        <button className="carousel-control-prev" type="button" data-bs-target="#videoCarousel" data-bs-slide="prev">
          <span className="carousel-control-prev-icon"></span>
        </button>
        <button className="carousel-control-next" type="button" data-bs-target="#videoCarousel" data-bs-slide="next">
          <span className="carousel-control-next-icon"></span>
        </button>
      </div>

      {/* üìù Headline */}
      <div className="hero-content">
        <h1 className="display-7 fw-bold">{t('heroTitle')}</h1>
        <p>{t('heroSubtitle')}</p>

        {/* ‚úÖ Dynamic Search */}
        {isFreelancer && (
          <div className="hero-search">
            <div className="hero-search-bar">
              <input
                type="text"
                placeholder={t('searchPlaceholder', 'Search for any service...')}
                value={searchTerm}
                onChange={(e) => setSearchTerm(e.target.value)}
              />
              <button onClick={handleSearch}>
                <i className="fas fa-search"></i>
              </button>
            </div>
            <div className="hero-suggestions">
              <button onClick={() => navigate('/categorydetails?category=website development')}>
                {t('websiteDev', 'website development ‚Üí')}
              </button>
              <button onClick={() => navigate('/categorydetails?category=architecture')}>
                {t('architectureDesign', 'architecture & interior design ‚Üí')}
              </button>
              <button onClick={() => navigate('/categorydetails?category=video editing')}>
                {t('videoEdit', 'video editing ‚Üí')}
              </button>
            </div>
          </div>
        )}
      </div>
    </section>
  );
};

export default Hero;
